{"operationName":"Me","variables":{},"query":"query Me {
  me {
    ...AccountInfo
    __typename
  }
}

fragment AccountInfo on Account {
  id
  accountProfile {
    ...AccountProfileInfo
    __typename
  }
  email
  features
  accountRoles
  __typename
}

fragment AccountProfileInfo on AccountProfile {
  id
  username
  name
  avatarUrl
  telegram
  twitter
  websiteUrl
  __typename
}"}

{"operationName":"AssetPrices","variables":{"currency":"usd","network":"ethereum"},"query":"query AssetPrices($network: Deployment!, $currency: Currency!) {
  assetPrices(network: $network, currency: $currency) {
    id
    price
    change24h
    __typename
  }
}"}

{"operationName":"VaultList","variables":{"ids":[]},"query":"query VaultList($ids: [ID!]!) {
  accounts(where: {id_in: $ids}) {
    id
    depositorSince
    ownerSince
    ownerships(first: 1000) {
      ...VaultListItem
      __typename
    }
    deposits(first: 1000) {
      id
      shares
      vault {
        ...VaultListItem
        __typename
      }
      __typename
    }
    assetManagements {
      ...VaultListItem
      __typename
    }
    __typename
  }
}

fragment VaultListItem on Vault {
  id
  name
  inception
  depositCount
  release {
    id
    __typename
  }
  comptroller {
    id
    denomination {
      ...Asset
      __typename
    }
    __typename
  }
  __typename
}

fragment Asset on Asset {
  id
  name
  symbol
  decimals
  __typename
}"}

{"operationName":"NetworkLatestStats","variables":{"currency":"usd","network":"ethereum"},"query":"query NetworkLatestStats($currency: Currency!, $network: Deployment!) {
  networkLatestStats(currency: $currency, network: $network) {
    gav
    vaults
    deposits
    __typename
  }
}"}

{"operationName":"DiscoverVaults","variables":{"currency":"usd","first":10,"network":"ethereum"},"query":"query DiscoverVaults($currency: Currency!, $first: Int!, $network: Deployment!) {
  topGainers: vaultList(
    currency: $currency
    first: $first
    network: $network
    orderBy: TOP_GAINERS
  ) {
    nodes {
      name
      address
      valid
      nsvCurrent
      gavCurrent
      numberOfDepositors
      performance24h
      __typename
    }
    __typename
  }
  latest: vaultList(
    currency: $currency
    first: $first
    network: $network
    orderBy: LATEST_VAULTS
  ) {
    nodes {
      name
      address
      valid
      nsvCurrent
      gavCurrent
      numberOfDepositors
      performance24h
      __typename
    }
    __typename
  }
  mostPopular: vaultList(
    currency: $currency
    first: $first
    network: $network
    orderBy: MOST_POPULAR
  ) {
    nodes {
      name
